Verenigde Staten / Canada
Horror / Sciencefiction
86 minuten

goed

met Warren Christie, Lloyd Owen en Ryan Robbins

'Apollo 18' is een film in documentaire-stijl over het &quot;waargebeurde&quot; verhaal van NASA's geheime achttiende vlucht met een 
Apollo raket naar de maan. De astronauten zijn geschokt wanneer ze buitenaards leven ontdekken tijdens hun missie. Hierna 
besluit de Amerikaanse overheid de missie geheim te houden voor de buitenwereld.
